import React from 'react'
const navigation = {
    name: 'Энциклопедия',
    links: [
        {
            name: 'Основы игры',
            link: 'google.com',
        },
        {
            name: 'Библиотека',
            link: 'google.com',
        },
        {
            name: 'Расы и классы',
            link: 'google.com',
        },
        {
            name: 'Локации',
            link: 'google.com',
        },
        {
            name: 'Предметы',
            link: 'google.com',
        },
        {
            name: 'Квесты',
            link: 'google.com',
        },
        {
            name: 'Монстры',
            link: 'google.com',
        },
    ]
};
const LeftMenu = () => (
    <aside className={'leftMenu-container'}>
        {Object.values(navigation).map((page, key) =>
            <div key={key} className={'suggestions'}>
                <h2>{page.name}</h2>
                <ul>
                    {(page.links).map((link, key) => <li key={key}><a href={link.link}>{link.name}</a></li>)}
                </ul>
            </div>)}

        <h6>Энциклопедия</h6>
        <ul>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
            <li></li>
        </ul>
    </aside>
);

export default LeftMenu
